import NavBar from './componentes/NavBar'
import { Route } from "react-router-dom";
import './App.css';
import { PokemonGrid } from './componentes/PokemonGrid';





function App() {

  return (
    <>
      <NavBar />
      <Route exact path="/pokedex/:id" >
       <h1>pokemon id</h1>
      </Route>
      <Route exact path="/">
        <PokemonGrid />
      </Route>
      <Route exact path="/create">
        <h1>create</h1>
      </Route>
      <Route exact path="/team">
        <h1>Team</h1>
      </Route>
    </>
  );
}


export default App;
